describe('Validating Track changes working when deleting paragraph', () => {
    let editor: DocumentEditor = undefined;
    beforeAll((): void => {
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false, enableSfdtExport: true });
        DocumentEditor.Inject(Editor, Selection, EditorHistory); editor.enableEditorHistory = true;
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((): void => {
        if (editor) {
            editor.destroy();
        }
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
    });
    it('Validating Track changes working when deleting paragraph', () => {
        editor.openBlank();
        editor.open(gettingStarted);
        editor.enableTrackChanges = true;
        editor.selection.select('0;1;1', '0;1;165');
        editor.editor.delete();
        expect(editor.revisions.length).toBe(1);
    });
});
describe('Validating combinenextPara behaviour in inside Table', () => {
    let editor: DocumentEditor = undefined;
    beforeAll((): void => {
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false, enableSfdtExport: true });
        DocumentEditor.Inject(Editor, Selection, EditorHistory); editor.enableEditorHistory = true;
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((): void => {
        if (editor) {
            editor.destroy();
        }
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
    });
    it('While selection start block is partially selected & selection end block is fully selected(with combine case)', () => {
        editor.openBlank();
        editor.editorModule.insertTable(1, 1);
        editor.editorModule.insertText('First Paragraph');
        editor.editorModule.onEnter();
        editor.editorModule.insertText('Second Paragraph');
        editor.editorModule.onEnter();
        editor.editorModule.insertText('Third Paragraph');
        editor.selection.select('0;0;0;0;0;11', '0;0;0;0;1;17');
        editor.editorModule.delete();
        let tableCell: TableCellWidget = (((editor.documentHelper.pages[0].bodyWidgets[0].childWidgets[0] as TableWidget).childWidgets[0] as TableRowWidget).childWidgets[0]) as TableCellWidget;
        let paraLength: number = tableCell.childWidgets.length;
        expect(paraLength).toEqual(1);
    });
    it('While selection start block is partially selected & selection end block also partially selected(without combine case)', () => {
        editor.openBlank();
        editor.editorModule.insertTable(1, 1);
        editor.editorModule.insertText('First Paragraph');
        editor.editorModule.onEnter();
        editor.editorModule.insertText('Second Paragraph');
        editor.editorModule.onEnter();
        editor.editorModule.insertText('Third Paragraph');
        editor.selection.select('0;0;0;0;0;11', '0;0;0;0;1;9');
        editor.editorModule.delete();
        let tableCell: TableCellWidget = (((editor.documentHelper.pages[0].bodyWidgets[0].childWidgets[0] as TableWidget).childWidgets[0] as TableRowWidget).childWidgets[0]) as TableCellWidget;
        let paraLength: number = tableCell.childWidgets.length;
        expect(paraLength).toEqual(3);
    });
    it('Rejecting new paragraphs tracked changes combine validation', () => {
        editor.openBlank();
        editor.editorModule.insertTable(1, 1);
        editor.editorModule.insertText('aaa');
        editor.enableTrackChanges = true;
        editor.editorModule.onEnter();
        editor.editorModule.onEnter();
        editor.editorModule.onEnter();
        editor.revisions.get(0).reject();
        let tableCell: TableCellWidget = (((editor.documentHelper.pages[0].bodyWidgets[0].childWidgets[0] as TableWidget).childWidgets[0] as TableRowWidget).childWidgets[0]) as TableCellWidget;
        let paraLength: number = tableCell.childWidgets.length;
        expect(paraLength).toEqual(1);
    });
});
