describe('Validating Not to throw script error when merging table cell in footer', () => {
    let editor: DocumentEditor = undefined;
        beforeAll((): void => {
            let ele: HTMLElement = createElement('div', { id: 'container' });
            document.body.appendChild(ele);
            editor = new DocumentEditor({ enableEditor: true, isReadOnly: false, enableSfdtExport: true });
            DocumentEditor.Inject(Editor, Selection, EditorHistory); editor.enableEditorHistory = true;
            (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
            (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
            (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
            (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
            editor.appendTo('#container');
        });
        afterAll((): void => {
            if (editor) {
                editor.destroy();
            }
            document.body.removeChild(document.getElementById('container'));
            editor = undefined;
            document.body.innerHTML = '';
        });
    it('Not to throw script error when merging table cell in footer - 1', () => {
        console.log('Not to throw script error when merging table cell in footer - 1');
        editor.openBlank();
        editor.selection.goToFooter();
        editor.editor.deleteTable();
        editor.selection.paragraphFormat.textAlignment = 'Center';
        editor.editor.insertTable();
        editor.selection.tableFormat.tableAlignment = 'Center';
        editor.selection.tableFormat.leftMargin = 1;
        editor.selection.tableFormat.rightMargin = 1;
        editor.selection.cellFormat.preferredWidthType = 'Point';
        editor.selection.cellFormat.preferredWidth = 150;
        editor.editor.insertText('pic');
        editor.editor.insertColumn();
        editor.selection.cellFormat.preferredWidth = 150;
        editor.editor.insertText('name');
        editor.selection.paragraphFormat.textAlignment = 'Center';
        editor.editor.insertRow();
        editor.editor.insertImage("https://images.app.goo.gl/T19kq4LgEDAFjLQ38", 150, 70);
        editor.editor.insertText("res.content[i].displayName)");
        editor.editor.insertText(" res.content[i].role");
        editor.editor.insertColumn();
        editor.selection.cellFormat.preferredWidth =300;
        editor.editor.mergeCells();
        editor.editor.insertTable();
        editor.selection.tableFormat.tableAlignment = 'Center';
        editor.selection.tableFormat.leftMargin = 1;
        editor.selection.tableFormat.rightMargin = 1;
        editor.selection.cellFormat.preferredWidthType = 'Point';
        editor.selection.cellFormat.preferredWidth = 120;
        editor.editor.insertText('pic');
        editor.editor.insertColumn();
        editor.selection.cellFormat.preferredWidth = 120;
        editor.editor.insertText('name');
        editor.selection.paragraphFormat.textAlignment = 'Center';
        editor.editor.insertRow();
        editor.editor.insertImage("https://images.app.goo.gl/T19kq4LgEDAFjLQ38", 150, 70);
        expect(() => { MoveCursorToNextCellMergeFooter(); }).not.toThrowError();
        editor.editor.insertText("displayname");
        editor.editor.insertText("Role");

        function MoveCursorToNextCellMergeFooter() {
            var startOffset = editor.selection.startOffset;
            var result = startOffset.split(';');
            var substr1 = result[8];
            var cellIndex = parseInt(substr1) + 1;
            var substr2 = result[0] + ";" + result[1] + ";" + result[2] + ";" + result[3] + ";" + result[4] + ";" + result[5] + ";" + result[6] + ";" + result[7];
            var substr3 = result[9] + ";" + result[10];
            startOffset = substr2 + ";" + cellIndex.toString() + ";" + substr3;
            editor.selection.select(startOffset, startOffset);
        }
    });
    it('Not to throw script error when merging table cell in footer - 2', () => {
        console.log('Not to throw script error when merging table cell in footer - 2');
        editor.openBlank();
        editor.selection.goToFooter();
        editor.editor.insertTable(2,2);
        editor.editor.insertText('hello');
        editor.selection.handleTabKey(true,false);
        editor.editor.insertText('world');
        editor.selection.handleTabKey(true,true);
        editor.selection.moveToNextCharacter();
        editor.editor.insertColumn();
        editor.selection.select('0;F;0;0;0;1;0;0','0;F;0;0;1;2;0;1');
        expect(() => { editor.editor.mergeCells() }).not.toThrowError();
    });
});
    
